        $this->addSql('INSERT INTO `product` (`id`, `sub_category_id`, `title`, `description`, `photo`, `price`, `slug`, `marque`, `color`, `composition`, `dimension`) VALUES
                            (180, 28, \'Litière Végétale\', \'<p>Liti&egrave;re &agrave; base de rafle de ma&iuml;s fran&ccedil;ais, tr&egrave;s absorbante et non poussi&eacute;reuse pour tous les petits mammif&egrave;res de compagnie.<br />\r\n<br />\r\n&bull; Super absorbante<br />\r\n&bull; Compostable et biod&eacute;gradable<br />\r\n&bull; Ne colle pas aux pattes ni aux poils</p>\', \'litiere-vegetale-b292f5ce5e.jpeg\', 17, \'litiere-vegetale\', \'Animalis\', NULL, NULL, NULL),
                            (181, 28, \'Litière avec Papier pour Rongeur\', \'<p>Liti&egrave;re papier pour rongeur de 30 litres &agrave; base de cellulose recycl&eacute; &agrave; 99,9%. Absorbe les odeurs.<br />\r\nContr&ocirc;le naturel des odeurs, aucun additif ni produit chimique, bio d&eacute;gradable, aucune poussi&egrave;re.</p>\', \'litiere-avec-papier-pour-rongeur-6e1a47eb36.jpeg\', 25, \'litiere-avec-papier-pour-rongeur\', \'Back To Nature\', NULL, \'Cellulose, 30 L\', \'30x18x46 cm\'),
                            (182, 28, \'Litière Paillage de Chanvre\', \'<p>Fibre naturelle issue du chanvre cultiv&eacute; en France sans pesticides ni irrigation intensive.<br />\r\n<br />\r\n&bull; Super absorbante<br />\r\n&bull; &Eacute;limine les odeurs<br />\r\n&bull; L&eacute;g&egrave;re<br />\r\n&bull; Compostable et utilisable comme fertilisant</p>\', \'litiere-paillage-de-chanvre-be10c000e1.jpeg\', 6, \'litiere-paillage-de-chanvre\', \'Animalis\', NULL, NULL, NULL),
                            (183, 28, \'Buchette Topinambour\', \'<p>Bois 100% naturel pour tous les rongeurs.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Longeur buchette : 15 centim&egrave;tres</li>\r\n	<li>R&eacute;gule la pousse dentaire</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Lot de 4 buchettes.</strong></p>\', \'buchette-topinambour-f54a9de133.jpeg\', 6, \'buchette-topinambour\', \'Animalis Nature\', NULL, NULL, NULL),
                            (184, 28, \'Bloc de Sel Vita Fit\', \'<p>La pierre &agrave; l&eacute;cher qui procure &agrave; tous les rongeurs les sels min&eacute;raux dont ils ont besoin.</p>\', \'bloc-de-sel-vita-fit-2e67a5b10c.jpeg\', 3, \'bloc-de-sel-vita-fit\', \'Vitakraft\', NULL, NULL, \'2.4x6.6x11.1 cm\'),
                            (185, 28, \'Terre à Bain pour Chinchillas\', \'<p>La terre &agrave; bain permet de conserver le pelage soyeux et brillant de l&#39;animal.</p>\', \'terre-a-bain-pour-chinchillas-538d607ecb.jpeg\', 4, \'terre-a-bain-pour-chinchillas\', \'Paradisio\', NULL, NULL, \'12x10.5x19.3 cm\'),
                            (186, 28, \'Litière végétale fraise\', \'<p>Liti&egrave;re &agrave; base de rafle de ma&iuml;s fran&ccedil;ais, parfum&eacute;e &agrave; la fraise, tr&egrave;s absorbante et non poussi&eacute;reuse pour tous les petits mammif&egrave;res de compagnie.</p>\', \'litiere-vegetale-fraise-273f2dd537.jpeg\', 12, \'litiere-vegetale-fraise\', \'Animalis\', NULL, \'10 L\', NULL),
                            (187, 29, \'Coupe Ongles pour Rongeur\', \'<p>Ce coupe-ongles vous permettra de couper les griffes de votre petit mammif&egrave;re en toute s&eacute;curit&eacute;. Outil adapt&eacute; &agrave; la taille de l&#39;animal. Manche bi-densit&eacute;, ergonomique et antid&eacute;rapant.</p>\', \'coupe-ongles-pour-rongeur-90a669cda3.jpeg\', 10, \'coupe-ongles-pour-rongeur\', \'Zolux\', \'Vert\', \'Plastique Pp / Caoutchouc Tpr / Acier Inoxydable\', \'7x0.9x13.9 cm\'),
                            (188, 29, \'Jouet Balle en Roseau\', \'<p>Jouet pour hamster, rat et tous autres rongeurs en roseau naturel en forme de balle. Convient &agrave; tout type de rongeurs : lapin nain, cochon d&#39;inde, gerbille...&nbsp;</p>\', \'jouet-balle-en-roseau-8fe38d1e32.jpeg\', 5, \'jouet-balle-en-roseau\', \'Rongis\', NULL, \'Roseau\', NULL),
                            (189, 29, \'Carotte à Ronger et Aromatisée\', \'<p>Jouet lapin nain et tous aures rongeurs en papier et fibre de ma&iuml;s aromatis&eacute;e &agrave; la carotte.<br />\r\n<br />\r\n100% naturel !<br />\r\n<br />\r\nConvient aux lapins, cochons d&#39;inde, gerbilles&hellip;</p>\', \'carotte-a-ronger-et-aromatisee-14cdf8a78f.jpeg\', 5, \'carotte-a-ronger-et-aromatisee\', \'Rongis\', NULL, NULL, \'Hauteur: 18cm\'),
                            (190, 29, \'Toilette d  Angle\', \'<p>Toilette de cage pour lapin nain ou toy, cochon d&#39;inde, gerbille, rat, &eacute;cureuil...<br />\r\nEn plastique inject&eacute;.<br />\r\nGrande facilit&eacute; de nettoyage.<br />\r\n2 crochets &agrave; l&#39;arri&egrave;re pour une meilleure stabilit&eacute;.<br />\r\nA positionner dans un angle.</p>\', \'toilette-dangle-ca2071e3f6.jpeg\', 7, \'toilette-dangle\', \'Moderna\', NULL, NULL, \'35x23.5x19 cm\'),
                            (191, 29, \'Pont Flexible en Bois\', \'<p>&nbsp;</p>\r\n\r\n<p>Pont flexible en bois pour hamster et souris.</p>\r\n\r\n<p>4 crochets m&eacute;tal inclus permettant la transformation en passerelle<br />\r\nCrochets &agrave; visser dans les rondins &agrave; &eacute;gale distance.<br />\r\nPlusieurs passerelles peuvent &ecirc;tre fix&eacute;es les unes aux autres, vous permettant de multiples combinaisons.</p>\', \'pont-flexible-en-bois-07d916b15f.jpeg\', 5, \'pont-flexible-en-bois\', \'Rongis\', NULL, \'Bois\', \'22 cm\'),
                            (192, 29, \'Nid Doux en Coton\', \'<p>Coton 100% naturel pour les petits rongeurs.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Coton naturel</li>\r\n	<li>Doux et confortable</li>\r\n</ul>\', \'nid-doux-en-coton-77d2853ae7.jpeg\', 5, \'nid-doux-en-coton\', \'Animalis Nature\', NULL, \'150 g\', NULL),
                            (193, 29, \'Biberon en Plastique XS\', \'<p>Biberon en plastique avec fixation inclue pour toute cage &agrave; barreaux.</p>\r\n\r\n<p><strong>Caract&eacute;ristiques :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Anti-goutte</li>\r\n	<li>Taille : XS</li>\r\n	<li>Contenance : 50ml</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Coloris al&eacute;atoire &agrave; l&#39;exp&eacute;dition.</p>\', \'biberon-en-plastique-xs-b3e9c64813.jpeg\', 2, \'biberon-en-plastique-xs\', \'Animalis\', NULL, NULL, NULL),
                            (194, 29, \'Biberon en Plastique M\', \'<p>Biberon en plastique avec fixation inclue pour toute cage &agrave; barreaux.</p>\r\n\r\n<p><strong>Caract&eacute;ristiques :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Anti-goutte</li>\r\n	<li>Taille : M</li>\r\n	<li>Contenance : 250ml</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Coloris al&eacute;atoire &agrave; l&#39;exp&eacute;dition</p>\', \'biberon-en-plastique-m-6e922d2b9d.jpeg\', 4, \'biberon-en-plastique-m\', \'Animalis\', NULL, \'250 ml\', NULL),
                            (195, 29, \'Lot de Jeux d  Haltères\', \'<p>Lot de 2 halt&egrave;res en pin naturel.<br />\r\n<br />\r\nConvient &agrave; toute type de rongeurs.</p>\', \'lot-de-jeux-dhalteres-d359d8d5f6.jpeg\', 4, \'lot-de-jeux-dhalteres\', \'Rongis\', NULL, \'Bois\', \'longueur: 9 cm\'),
                            (196, 26, \'Filtre MultiClear Set 15000\', \'<p>Pr&ecirc;t au raccordement, le filtre gravitaire compact en kit complet Pontec MultiClear 15000 assure une eau claire, saine et propre dans votre bassin jusqu&#39;&agrave; 15 000 litres sans poisson. Le kit comprend entre autres une puissante pompe de filtration (3 500 l/h) et 3 m de tuyau (3/4&quot;). L&#39;appareil &agrave; ultraviolets int&eacute;gr&eacute; (11 W) d&eacute;barrasse de mani&egrave;re efficace l&#39;eau du phytoplancton et des mati&egrave;res troubles. Combin&eacute; au filtre gravitaire avec plusieurs mat&eacute;riaux filtrants, le kit offre une garantie d&#39;eau claire.</p>\r\n\r\n<p><strong>Le kit comprend :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>un filtre gravitaire multichambre avec diff&eacute;rents mat&eacute;riaux filtrants</li>\r\n	<li>un appareil &agrave; ultraviolets int&eacute;gr&eacute;</li>\r\n	<li>une puissante pompe de filtration</li>\r\n	<li>un tuyau</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>L&#39;entretien du filtre se fait facilement sans difficult&eacute; gr&acirc;ce &agrave; l&#39;indicateur du degr&eacute; d&#39;encrassement.</p>\', \'filtre-multiclear-set-15000-6d2acf74a3.jpeg\', 254, \'filtre-multiclear-set-15000\', \'Pontec\', \'Noir\', \'Plastique\', \'57x39x51 cm\'),
                            (197, 26, \'Kit de Filtration + UV BioSmart Set 24000\', \'<p>L&#39;installation d&#39;un kit de filtration efficace, adapt&eacute; au volume, &agrave; la population et &agrave; l&#39;exposition de votre bassin, vous garantit une eau saine et translucide. La circulation de l&#39;eau est n&eacute;cessaire pour &eacute;viter la stagnation et l&#39;apparition d&#39;algues ou de d&eacute;p&ocirc;t au fond du bassin.</p>\r\n\r\n<p>Le kit de filtration Oase BioSmart Set 24000 est compos&eacute; d&#39;un filtre gravitaire de bassin, d&#39;un st&eacute;rilisateur UV et d&#39;une pompe. Il est parfaitement adapt&eacute; aux bassins de 18 m3 maximum (6 m3 avec carpes Ko&iuml;).</p>\r\n\r\n<p>La maintenance du filtre est facilit&eacute;e par l&rsquo;affichage de niveau d&rsquo;encrassement, les poign&eacute;es de nettoyage et le siphon de fond. En effet, une sortie d&rsquo;&eacute;vacuation int&eacute;gr&eacute;e dans le fond permet de retirer la salet&eacute; du syst&egrave;me de filtration !</p>\r\n\r\n<p>L&#39;utilisation de ce filtre vous garantit une eau claire et limpide gr&acirc;ce &agrave; l&rsquo;&eacute;puration biom&eacute;canique et &agrave; l&#39;ultraviolet inclus, qui permet, pour sa part, la suppression du phytoplancton et des agents pathog&egrave;nes.</p>\r\n\r\n<p><strong>Caract&eacute;ristiques :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Dimensions (L x P x H) mm : 920 x 555 x 405</li>\r\n	<li>Tension nominale : 220 - 240 V / 50/60 Hz</li>\r\n	<li>Puissance absorb&eacute;e UV W : 24</li>\r\n	<li>Puissance absorb&eacute;e pompe W : 60</li>\r\n	<li>Longueur c&acirc;ble &eacute;lectrique UV m : 5,00</li>\r\n	<li>Longueur c&acirc;ble &eacute;lectrique pompe m : 10,00</li>\r\n	<li>Poids net kg : 17,00</li>\r\n	<li>Garantie : 2ans</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Plus produit :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Combinaison de l&#39;&eacute;puration biom&eacute;canique et de la technologie efficace des ultraviolets</li>\r\n	<li>Garantie d&#39;eau claire Oase</li>\r\n	<li>Apport d&#39;oxyg&egrave;ne par un mouvement sp&eacute;cial de l&#39;eau</li>\r\n	<li>Poign&eacute;es de nettoyage pour une maintenance pratique</li>\r\n	<li>Avec indicateurs du degr&eacute; de pollution et de la temp&eacute;rature de l&#39;eau</li>\r\n	<li>Vanne de fond pour enlever ais&eacute;ment les grosses salet&eacute;s</li>\r\n	<li>Facile &agrave; camoufler, puisque le bo&icirc;tier du filtre s&#39;enterre au ?</li>\r\n	<li>Les filtres et les pompes sont parfaitement coordonn&eacute;s entre eux</li>\r\n	<li>Convient aux bassins jusqu&#39;&agrave; 24,0 m&sup3;</li>\r\n</ul>\', \'kit-de-filtration-uv-biosmart-set-24000-04435cf022.jpeg\', 704, \'kit-de-filtration-uv-biosmart-set-24000\', \'Oase\', \'Noir\', \'Plastique\', \'78.4x56.9x69.5 cm\'),
                            (198, 26, \'Filtre UV-C pour Bassin\', \'<p>Depuis longtemps, on utilise les mat&eacute;riels &agrave; rayonnement UV-C pour &eacute;liminer les algues en suspension dans les aquariums ou les bassins de jardin et pour inhiber la croissance de germes pathog&egrave;nes.</p>\', \'filtre-uv-c-pour-bassin-a6a6739929.jpeg\', 76, \'filtre-uv-c-pour-bassin\', \'Velda\', \'Noir\', \'Plastique\', \'23x47x10 cm\')');
        $this->addSql('INSERT INTO `product` (`id`, `sub_category_id`, `title`, `description`, `photo`, `price`, `slug`, `marque`, `color`, `composition`, `dimension`) VALUES
                            (199, 26, \'Pompe Jet d  Eau Solaire Pondo Solar 250 Control\', \'<p>Installez votre jet d&#39;eau l&agrave; o&ugrave; vous voulez ! Vous n&#39;avez aucune limite puisque le jet d&#39;eau solaire<br />\r\nPondoSolar 150 n&#39;a besoin d&#39;aucun branchement &eacute;lectrique et est si facile &agrave; installer. En outre, avec les 4 ajutages qui l&#39;accompagnent, votre jet d&#39;eau d&eacute;crira diff&eacute;rentes figures.</p>\r\n\r\n<p>Le kit comprend la pompe de jet d&#39;eau 6V avec 150 l/h, un panneau solaire de 1,4 watt ainsi qu&#39;un c&acirc;ble de 5 m et un piquet.</p>\r\n\r\n<p><strong>Les points forts du produit :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Pompe pour jet d&#39;eau 6V avec 150 l/h</li>\r\n	<li>C&acirc;ble de raccordement 5 m</li>\r\n	<li>Panneau solaire de 1,4 watt</li>\r\n	<li>Garantie : 2 ans</li>\r\n</ul>\', \'pompe-jet-deau-solaire-pondo-solar-250-control-9933660f3e.jpeg\', 79, \'pompe-jet-deau-solaire-pondo-solar-250-control\', \'Pontec\', \'Noir\', \'Plastique\', \'23x19.5x8 cm\'),
                            (200, 26, \'Pompe Jet d  Eau Aquarius Fountain Set Classic 2500\', \'<p>Pompe compacte pour jet d&#39;eau facile d&#39;entretien, orientation individuelle des jets d&#39;eau et sortie suppl&eacute;mentaire pour mini-ruisseaux ou gargouilles.</p>\r\n\r\n<p><strong>Caract&eacute;ristiques :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Dimensions (L x P x H) mm : 180 x 205 x 140</li>\r\n	<li>Tension nominale : 220 - 240 V / 50 Hz</li>\r\n	<li>Puissance absorb&eacute;e W : 40</li>\r\n	<li>Longueur de c&acirc;ble &eacute;lectrique m : 10,00</li>\r\n	<li>Poids net kg : 2,20</li>\r\n	<li>Garantie (+ extension de garantie) : 2 + 1 ans</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Plus produit :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Deuxi&egrave;me sortie r&eacute;glable s&eacute;par&eacute;ment</li>\r\n	<li>3 ajutages cr&eacute;ant diff&eacute;rentes figures d&#39;eau sont compris dans la fourniture</li>\r\n	<li>R&eacute;glage m&eacute;canique facile de la hauteur du jet</li>\r\n	<li>Tube t&eacute;lescopique &agrave; t&ecirc;te orientable int&eacute;gr&eacute;e permettant d&#39;orienter &agrave; souhait les jets d&#39;eau</li>\r\n	<li>Pieds assurant une meilleure stabilit&eacute; sur le fond du bassin</li>\r\n	<li>Protection thermique int&eacute;gr&eacute;e</li>\r\n</ul>\', \'pompe-jet-deau-aquarius-fountain-set-classic-2500-90f5ae8c8b.jpeg\', 84, \'pompe-jet-deau-aquarius-fountain-set-classic-2500\', \'Oase\', \'Noir\', \'Plastique\', \'29.5x19.5x15.2 cm\'),
                            (201, 26, \'Set Aération Solaire PondoSolar Air 150 Plus\', \'<p>Pompe d&rsquo;a&eacute;ration avec module solaire 1 W / 6 V, flexible d&rsquo;air de 2 m et diffuseur d&rsquo;air. &Eacute;quip&eacute;e d&rsquo;une batterie Li-ion 3,7 V / 2000 mA pour pour a&eacute;rer au cr&eacute;puscule.</p>\', \'set-aeration-solaire-pondosolar-air-150-plus-d5be91213c.jpeg\', 50, \'set-aeration-solaire-pondosolar-air-150-plus\', \'Pontec\', \'Gris, Noir\', \'Plastique\', \'18x18x8.8 cm\'),
                            (202, 26, \'Kit de Réparation de Bâches PVC\', \'<p>Le kit de r&eacute;paration pour b&acirc;ches en PVC contient un tube de colle haute performante de 75ml ainsi qu&#39;un embout pour les collages fins et un morceau de b&acirc;che PVC 1mm de 20x40 cm pour vos r&eacute;parations. La colle est utilisable sous l&#39;eau et compatible avec la faune et la flore de votre bassin.</p>\', \'kit-de-reparation-de-baches-pvc-959a0c0321.jpeg\', 16, \'kit-de-reparation-de-baches-pvc\', \'Oase\', NULL, \'Aluminium\', \'5x15.5x5 cm\'),
                            (203, 26, \'Pompe pour Fontaine Super 2000\', \'<p>Les nouvelles pompes Super Fountain de VT sont &eacute;conomes tout en pr&eacute;sentant une grande capacit&eacute;. Leurs moteurs sont prot&eacute;g&eacute;s par un dispositif de protection thermique et sont enti&egrave;rement &eacute;tanches.</p>\', \'pompe-pour-fontaine-super-2000-0bc95e3137.jpeg\', 50, \'pompe-pour-fontaine-super-2000\', \'Velda\', \'Noir\', \'Plastique injecté\', \'22x37x13.5 cm\'),
                            (204, 26, \'Épuisette Carrée\', \'<p>&Eacute;puisettes polyvalentes pour bassins. Son manche est stable. Les &eacute;puisettes sont &agrave; grosses mailles et en mat&eacute;riaux haut de gamme.</p>\', \'epuisette-carree-79cc2024ce.jpeg\', 11, \'epuisette-carree\', \'Velda\', \'Gris\', \'Nylon\', \'25x25x120 cm\'),
                            (205, 25, \'Cartouches Bio-Bact Taille M\', \'<p>Cartouches taille M (X1) &agrave; changer tous les 90 jours : pour CF 80, compatible Maggi 380, CFBIO 150&amp;250 et Superclean 60&amp;90.<br />\r\nPermet un d&eacute;veloppement bact&eacute;rien important.<br />\r\nPour Aqua 60, 80, Fishome 60, Aquarium 80</p>\', \'cartouches-bio-bact-taille-m-cd90e66ff1.jpeg\', 9, \'cartouches-bio-bact-taille-m\', \'Ciano\', NULL, NULL, \'4x6.5x15 cm\'),
                            (206, 25, \'Mousse Foam Taille S\', \'<p>Mousse taille S (X1) &agrave; changer tous les 90 jours : Pour CF 40, compatible Maggi 200 et SuperClean 40.<br />\r\nPermet une filtration m&eacute;canique optimale.<br />\r\nPour Aqua 15, 20, 30 et Nexus 15 et 25.</p>\', \'mousse-foam-taille-s-69220cc3c4.jpeg\', 5, \'mousse-foam-taille-s\', \'Ciano\', \'Noir\', NULL, \'4x6.5x15 cm\'),
                            (207, 25, \'Programmateur Mécanique\', \'<p>Cette prise programmable est compacte, facile et rapide &agrave; r&eacute;gler. Elle vous permettra de faire fonctionner automatiquement un &eacute;clairage ou un appareil &eacute;lectrique sur une ou plusieurs plages horaires r&eacute;p&eacute;t&eacute;es chaque jour.<br />\r\n<br />\r\n<strong>Caract&eacute;ristiques du programmateur Otio :</strong></p>\r\n\r\n<ul>\r\n	<li>Programmation : par tranche de 15 minutes</li>\r\n	<li>Alimentation : 230V - 50Hz</li>\r\n	<li>Puissance maximale : 3500W</li>\r\n	<li>Garantie : 2 ans</li>\r\n	<li>Coloris : Bleu</li>\r\n</ul>\', \'programmateur-mecanique-2c554850d1.jpeg\', 10, \'programmateur-mecanique\', \'Otio\', \'Bleu\', NULL, NULL),
                            (208, 25, \'Thermomètre Flottant avec Ventouse\', \'<p>Un thermom&egrave;tre flottant avec ventouse &agrave; installer o&ugrave; vous le souhaitez dans votre aquarium. Il vous permettra de garder une temp&eacute;rature optimale!</p>\', \'thermometre-flottant-avec-ventouse-d7a90a45d3.jpeg\', 4, \'thermometre-flottant-avec-ventouse\', \'Zolux\', NULL, \'Plastique, Verre, Kerosene, Papier\', \'2.5x2x10.5 cm\'),
                            (209, 25, \'Kit d  Entretien pour Aquarium BiOrb\', \'<p>Ce kit d&#39;entretien est adapt&eacute; &agrave; tous les aquariums BiOrb. Son changement est facile et &agrave; effectuer toutes les 4-8 semaines. Ce kit comprend ainsi une nouvelle cartouche de filtration BiOrb, un pad de nettoyage sp&eacute;cial pour enlever la salet&eacute; et les algues de la surface int&eacute;rieure de l&#39;aquarium BiOrb. Fourni avec un kit de conditionneur d&#39;eau anti-chlore.</p>\r\n\r\n<p>La fr&eacute;guence de changement du filtre d&eacute;pend ainsi de la taille de votre BiOrb et du nombre de poissons. Veuillez vous r&eacute;f&eacute;rer aux instructions de votre BiOrb pour plus de d&eacute;tails.</p>\', \'kit-dentretien-pour-aquarium-biorb-700e852677.jpeg\', 12, \'kit-dentretien-pour-aquarium-biorb\', \'Oase\', NULL, NULL, NULL),
                            (210, 25, \'Pierre de Diffusion d  Air pour Aquarium BiOrb\', \'<p>Changer le diffuseur d&#39;air de votre aquarium BiOrb est une chose tr&egrave;s importante ! En effet, un diffuseur us&eacute; ou encrass&eacute; provoque un d&eacute;bit d&#39;air plus faible. Cela provoque une moins bonne oxyg&eacute;nation et une moins bonne filtration de votre aquarium BiOrb. Cela peut &eacute;galement faire forcer la pompe &agrave; air BiOrb et l&#39;endommager.</p>\r\n\r\n<p>Le diffuseur se place sous la cartouche filtrante, il brise le flux d&#39;air dans l&#39;aquarium et le divise en fines bulles. Il permet &eacute;galement de r&eacute;duire le bruit de la pompe.</p>\', \'pierre-de-diffusion-dair-pour-aquarium-biorb-8f55511fa0.jpeg\', 6, \'pierre-de-diffusion-dair-pour-aquarium-biorb\', \'Oase\', \'Blanc\', NULL, NULL),
                            (211, 25, \'Kit d  Entretien pour Aquarium BiOrb\', \'<p>Ce kit d&#39;entretien est adapt&eacute; &agrave; tous les aquariums BiOrb. Son changement est facile et &agrave; effectuer toutes les 4-8 semaines. Ce kit comprend ainsi une nouvelle cartouche de filtration BiOrb, un pad de nettoyage sp&eacute;cial pour enlever la salet&eacute; et les algues de la surface int&eacute;rieure de l&#39;aquarium BiOrb. Fourni avec un kit de conditionneur d&#39;eau anti-chlore.</p>\r\n\r\n<p>La fr&eacute;guence de changement du filtre d&eacute;pend ainsi de la taille de votre BiOrb et du nombre de poissons. Veuillez vous r&eacute;f&eacute;rer aux instructions de votre BiOrb pour plus de d&eacute;tails.</p>\', \'kit-dentretien-pour-aquarium-biorb-244c9c8b0e.jpeg\', 12, \'kit-dentretien-pour-aquarium-biorb\', \'Oase\', NULL, NULL, NULL),
                            (212, 25, \'Thermomètre Digital\', \'<p>Un thermom&egrave;tre digital pour une utilisation sur la vitre ext&egrave;rieure de votre aquarium.</p>\', \'thermometre-digital-e4a5774116.jpeg\', 5, \'thermometre-digital\', \'Zolux\', NULL, \'Plastique\', \'2x0.1x13 cm\'),
                            (213, 25, \'Racloir 4 en 1 Téléscopique\', \'<p>Racloir t&eacute;l&eacute;scopique de longueur de : 42 &agrave; 60 centim&egrave;tres. Contiens un racloir &agrave; lame et 3 &eacute;ponges.</p>\', \'racloir-4-en-1-telescopique-6c72813f04.jpeg\', 18, \'racloir-4-en-1-telescopique\', \'Zolux\', NULL, \'Plastique\', \'6.8x2x41.5 cm\'),
                            (214, 25, \'Filtre Intérieur CF-80 pour Aquarium\', \'<p>Le filtre Ciano CF-80 est facile &agrave; installer et n&eacute;cessite un entretien r&eacute;duit. Il est optimis&eacute; pour minimiser le stress de vos poissons en r&eacute;duisant les interventions dans l&rsquo;aquarium. Le rejet est &eacute;quip&eacute; d&#39;une rampe de pulv&eacute;risation amovible pour une distribution plus uniforme de l&#39;eau et une augmentation de l&#39;oxyg&eacute;nation de l&#39;aquarium.<br />\r\n<br />\r\n<strong>Caract&eacute;ristiques :</strong><br />\r\n<br />\r\n&bull; facile &agrave; installer<br />\r\n&bull; entretien r&eacute;duit<br />\r\n&bull; triple filtration<br />\r\n&bull; rampe de diffusion<br />\r\n&bull; d&eacute;bit max. de la pompe (l/h) : 380<br />\r\n<br />\r\n<strong>Contenu du produit :</strong><br />\r\n<br />\r\n&bull; 1 dose Ciano Water Clear M<br />\r\n&bull; 1 mousse Ciano Foam M</p>\', \'filtre-interieur-cf-80-pour-aquarium-d549389d82.jpeg\', 25, \'filtre-interieur-cf-80-pour-aquarium\', \'Ciano\', \'Noir\', NULL, \'6.2x4.3x18.5 cm\'),
                            (215, 24, \'Gravier Chocolat/Terra en Coussin\', \'<p>Ce gravier chocolat-terra de granulom&eacute;trie 10-25 mm apportera un fond aquatique tr&egrave;s esth&eacute;tique &agrave; votre aquarium. Ce lit de gravier aux tonalit&eacute;s chaudes chocolat-terra fait penser aux terres sauvages rouges. Votre aquarium prendra des airs d&eacute;sertiques chaleureux.</p>\', \'gravier-chocolat-terra-en-coussin-8e9af84e1d.jpeg\', 9, \'gravier-chocolat-terra-en-coussin\', \'Aquadisio\', \'Chocolat, Terre\', \'Quartz\', NULL),
                            (216, 24, \'Noir Intense pour Aquarium\', \'<p>Aquadisio Noir Intense finira d&#39;habiller le fond de votre aquarium avec un certain c&ocirc;t&eacute; chic qui forcera l&#39;admiration. Plac&eacute; sur un sol nutritif, il embellira vos plantes qui resplendiront de reconnaissance. Son aspect sombre et &eacute;nigmatique s&eacute;duira assur&eacute;ment vos poissons qui ne se lasseront pas de le c&ocirc;toyer au quotidien. Sp&eacute;cialement fabriqu&eacute; pour d&eacute;corer votre aquarium.</p>\', \'noir-intense-pour-aquarium-e72b6039c1.jpeg\', 20, \'noir-intense-pour-aquarium\', \'Aquadisio\', \'Noir\', \'Quartz\', \'28.5x9.5x41.5 cm\'),
                            (217, 24, \'Sable Blanc en Doypack\', \'<p>Ce sable pour aquarium d&#39;eau douce ou eau de mer poss&egrave;de une granulom&eacute;trie fine de 4-8 mm. Avec sa belle couleur blanche, il formera au fond de votre aquarium un lit d&eacute;coratif lumineux qui vous plongera dans une ambiance relaxante &eacute;voquant les plages de sable blanc. Il apportera un environnement naturel &agrave; vos poissons.</p>\', \'sable-blanc-en-doypack-dc9c42b441.jpeg\', 4, \'sable-blanc-en-doypack\', \'Aquadisio\', NULL, \'Sable\', NULL),
                            (218, 24, \'Terreau pour Aquarium\', \'<p>Terreau pour plantes aquatiques. Ne trouble pas l&rsquo;eau, apporte les &eacute;l&eacute;ments nutritifs essentiels pour une bonne croissance des plantes et renforce les couleurs du feuillage. Composition enti&egrave;rement naturelle, sans ajout chimique. Jusqu&#39;&agrave; 200L.</p>\', \'terreau-pour-aquarium-c49c0c72d9.jpeg\', 10, \'terreau-pour-aquarium\', \'Animalis\', NULL, NULL, NULL),
                            (219, 24, \'Sable Jaune Fluo en Doypack\', \'<p>Ce sable pour aquarium d&#39;eau douce ou eau de mer poss&egrave;de une granulom&eacute;trie fine de 4-8 mm. Avec sa belle couleur flashy jaune fluo, il formera au fond de votre aquarium un lit d&eacute;coratif qui vous plongera dans une ambiance tonique pleine de gaiet&eacute;. Il apportera un environnement naturel &agrave; vos poissons.</p>\', \'sable-jaune-fluo-en-doypack-25e3c6019c.jpeg\', 6, \'sable-jaune-fluo-en-doypack\', \'Aquadisio\', \'Jaune Fluo\', \'Sable\', NULL),
                            (220, 24, \'Quartz Rouge Provence\', \'<p>Aquadisio Quartz rouge finira d&#39;habiller le fond de votre aquarium avec un certain dynamisme qui sera du plus bel effet. Plac&eacute; sur un sol nutritif, il embellira vos plantes. La granulom&eacute;trie de ce quartz est de 2/3 mm.</p>\', \'quartz-rouge-provence-04d3a5be18.jpeg\', 7, \'quartz-rouge-provence\', \'Aquadisio\', \'Rouge\', \'Quartz\', NULL),
                            (221, 5, \'Gravier Gris/Pomme en Coussin\', \'<p>Ce gravier gris-bleu de granulom&eacute;trie 10-25 mm apportera un fond aquatique tr&egrave;s esth&eacute;tique &agrave; votre aquarium. Ce lit de gravier aux tonalit&eacute;s gris-pomme fait penser aux eaux des tropiques si claires. Votre aquarium prendra des airs de lagons.</p>\', \'gravier-gris-pomme-en-coussin-7dae5e3aa1.jpeg\', 9, \'gravier-gris-pomme-en-coussin\', \'Aquadisio\', \'Gris, Pomme\', \'Quartz\', NULL),
                            (222, 24, \'Gravier Chocolat/Turquoise en Coussin\', \'<p>Ce gravier chocolat-turquoise de granulom&eacute;trie 10-25 mm apportera un fond aquatique tr&egrave;s esth&eacute;tique &agrave; votre aquarium. Ce lit de gravier aux tonalit&eacute;s chaudes et exotiques chocolat-turquoise exaltera une ambiance harmonieuse et raffin&eacute;e.</p>\', \'gravier-chocolat-turquoise-en-coussin-e8af8f8350.jpeg\', 9, \'gravier-chocolat-turquoise-en-coussin\', \'Aquadisio\', \'Chocolat, Turquoise\', \'Quartz\', NULL),
                            (223, 23, \'Engrais Liquide pour Aquarium Eau Douce\', \'<p>L&#39;engrais liquide Animalis contient des sels min&eacute;raux qui favorisent un bon d&eacute;veloppement des plantes de l&#39;aquarium. Il pr&eacute;vient l&#39;affaiblissement de la flore aquatique et revitalise les plantes en souffrance.</p>\r\n\r\n<p><strong>Caract&eacute;ristiques :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>D&eacute;veloppe et renforce les plantes aquatiques</li>\r\n	<li>Revitalise</li>\r\n</ul>\', \'engrais-liquide-pour-aquarium-eau-douce-60eff5b6fa.jpeg\', 8, \'engrais-liquide-pour-aquarium-eau-douce\', \'Animalis\', NULL, \'250 ml\', NULL),
                            (224, 23, \'Élimine les Algues AlguMin pour Aquarium d  Eau Douce\', \'<p>A utiliser d&egrave;s l&#39;apparition d&#39;algues .Action &agrave; long terme, &agrave; la fois pr&eacute;ventive et curative : pr&eacute;vient et &eacute;limine toutes sortes d&#39;algues .Contribue &agrave; inhiber le d&eacute;veloppement des algues (effet &laquo; d&#39;eau noire &raquo;) .Inoffensif pour les plantes, les poissons et les micro-organismes (en respectant les doses recommand&eacute;es et les conditions d&#39;utilisation)</p>\', \'elimine-les-algues-algumin-pour-aquarium-deau-douce-611ae076bd.jpeg\', 15, \'elimine-les-algues-algumin-pour-aquarium-deau-douce\', \'Tetra\', \'Jaune\', \'250 ml\', NULL),
                            (225, 23, \'Médicament contre les Maladies Courantes Goldfish GoldMed pour Poissons d  Eau Froide\', \'<p>Vaste combinaison d&#39;agents actifs. N&#39;endommage ni les plantes ni les bact&eacute;ries du filtre, en respectant les doses recommand&eacute;es. Utile pour les blessures de tous types comme les nageoires d&eacute;chir&eacute;es ou des voiles opaques sur le corps et les yeux.</p>\', \'medicament-contre-les-maladies-courantes-goldfish-goldmed-pour-poissons-deau-froide-9854528113.jpeg\', 8, \'medicament-contre-les-maladies-courantes-goldfish-goldmed-pour-poissons-deau-froide\', \'Tetra\', \'Jaune\', NULL, \'30x55x122 cm\')');
        $this->addSql('INSERT INTO `product` (`id`, `sub_category_id`, `title`, `description`, `photo`, `price`, `slug`, `marque`, `color`, `composition`, `dimension`) VALUES                   
                            (226, 23, \'Taitement Anti-algues PhosEx Rapid pour Aquarium\', \'<p><strong>Pour une eau d&#39;aquarium adapt&eacute;e aux poissons et aux plantes : fixe efficacement les phosphates et pr&eacute;vient la croissance ind&eacute;sirable des algues. Pour aquariums d&#39;eau douce, tortues d&#39;eau et crevettes.</strong></p>\r\n\r\n<p>Mesure d&#39;urgence efficace : fluide &agrave; base de fer pour abaisser les taux de phosphates trop &eacute;lev&eacute;s. &Eacute;limine les phosphates, pr&eacute;vient la formation des algues, clarifie l&#39;eau trouble des aquariums. Mode d&#39;action : un compos&eacute; de fer liquide fixe efficacement et durablement les phosphates dissous dans l&#39;eau. L&#39;effet est visible &agrave; la turbidit&eacute; brun&acirc;tre de l&#39;eau, qui dispara&icirc;t au bout de 2 &agrave; 24 h.</p>\', \'taitement-anti-algues-phosex-rapid-pour-aquarium-4bf75be1e9.jpeg\', 14, \'taitement-anti-algues-phosex-rapid-pour-aquarium\', \'JBL\', \'Bleu\', \'250 ml\', \'7.8x3.3x18 cm\'),
                            (227, 16, \'Bactéries BioDigest pour Aquarium\', \'<p><strong>BIODIGEST</strong>&nbsp;est un m&eacute;lange naturel et concentr&eacute; de diff&eacute;rentes souches nitrifiantes et d&eacute;nitrifiantes de bact&eacute;ries vivantes naturelles. Ces bact&eacute;ries permettent la mise en place rapide de la filtration biologique et le nettoyage par digestion des d&eacute;chets organiques de l&rsquo;aquarium.</p>\r\n\r\n<p>Elles contribuent ainsi &agrave; la purification de l&rsquo;eau, &agrave; la r&eacute;duction des nitrites, des nitrates, des phosphates et pr&eacute;viennent la prolif&eacute;ration des algues filamenteuses par comp&eacute;tition alimentaire.&nbsp;<strong>BIODIGEST</strong>&nbsp;permet d&rsquo;obtenir une eau de qualit&eacute; optimale aussi bien en eau douce qu&rsquo;en eau de mer.</p>\r\n\r\n<p>Une ampoule traite 120 &agrave; 1000 litres. Lot de 6 ampoules.</p>\', \'bacteries-biodigest-pour-aquarium-3dd022d82a.jpeg\', 16, \'bacteries-biodigest-pour-aquarium\', \'Prodibio\', NULL, NULL, \'7.5x1.7x7 cm\'),
                            (228, 23, \'Anti-algue Protalon 707\', \'<p>Protalon traite avec succ&egrave;s les algues filamenteuses, bleues, vertes, &agrave; barbe, visqueuses, brunes et en suspension. Il est sans danger pour vos plantes. Il vous permettra de proc&eacute;der au traitement de votre bassin et de red&eacute;couvrir un aquarium propre et sain comme au premier jour. Disponible en flacon de 20 ml.</p>\', \'anti-algue-protalon-707-0886eba700.jpeg\', 16, \'anti-algue-protalon-707\', \'Esha 2000\', NULL, \'20 ml\', NULL),
                            (229, 23, \'Pot GH+ pour Aquarium\', \'<p>GH+ est destin&eacute; aux aquariums d&rsquo;eau douce. Le GH ou duret&eacute; totale de l&rsquo;eau correspond principalement &agrave; la quantit&eacute; d&rsquo;ions calcium (Ca2+) et magn&eacute;sium (Mg2+) pr&eacute;sents dans l&rsquo;eau. Plus la valeur de GH est haute plus l&#39;eau est dure. Plus la valeur de GH est basse plus l&#39;eau est douce.</p>\r\n\r\n<p>Les valeurs de GH doivent &ecirc;tre adapt&eacute;es &agrave; celles du biotope de l&rsquo;aquarium.</p>\r\n\r\n<p><strong>Utilisation :</strong>&nbsp;une dose de GH+ augmente la duret&eacute; totale de 100 litres d&rsquo;eau de 3&deg; GH.</p>\', \'pot-gh-pour-aquarium-2e1698ed37.jpeg\', 10, \'pot-gh-pour-aquarium\', \'Prodibio\', \'Blanc\', NULL, \'7x7x9 cm\'),
                            (230, 23, \'Traitement Punktol Plus 125 pour Aquarium\', \'<p><strong>Traitement de la maladie des points blancs et autres ectoparasites</strong></p>\r\n\r\n<p>En cas d&#39;infestation parasitaire des poissons d&#39;eau douce et d&#39;eau de mer et, dans certaines limites, des invert&eacute;br&eacute;s en aquarium. Contre la r&eacute;infestation : le dosage doit &ecirc;tre r&eacute;p&eacute;t&eacute; plusieurs fois en raison du cycle de vie de l&#39;agent pathog&egrave;ne. Ces agents se d&eacute;tachent du poisson au bout de quelques jours et coulent au fond de l&#39;eau. Sans cuivre. H&ocirc;pital JBL en ligne : acc&egrave;s &agrave; l&rsquo;identification des maladies des poissons.</p>\', \'traitement-punktol-plus-125-pour-aquarium-482ecc66b7.jpeg\', 10, \'traitement-punktol-plus-125-pour-aquarium\', \'JBL\', NULL, \'100 ml\', NULL),
                            (231, 22, \'Analyse de l  Eau par Smartphone Pro Scan pour Eau Douce\', \'<p>Contient 24 languettes d&#39;analyse (GH, KH, pH, nitrite, nitrate, chlore et calcul du CO?) avec nuancier sp&eacute;cial JBL ProScan. Le nuancier est utilis&eacute; comme r&eacute;f&eacute;rence pendant le balayage de la languette d&rsquo;analyse.&nbsp;<br />\r\nLe r&eacute;sultat est analys&eacute; et en cas de besoin</p>\', \'analyse-de-leau-par-smartphone-pro-scan-pour-eau-douce-2febd30edd.jpeg\', 26, \'analyse-de-leau-par-smartphone-pro-scan-pour-eau-douce\', \'JBL\', NULL, NULL, \'50x120x150 cm\'),
                            (232, 22, \'Sel de Mer Reef Crystals\', \'<p>Sels optimis&eacute;s pour aquariums r&eacute;cifaux Reef Crystals 4kg - 110 litres</p>\', \'sel-de-mer-reef-crystals-b75166003a.jpeg\', 19, \'sel-de-mer-reef-crystals\', \'Aquarium Systems\', NULL, \'Poudre, 4Kg\', NULL),
                            (233, 22, \'Conditionneur d  Eau Biotopol pour Aquarium\', \'<p><strong>Une eau d&rsquo;aquarium adapt&eacute;e aux poissons et aux plantes : pour une nouvelle installation ou un renouvellement d&rsquo;eau et pour fortifier les poissons apr&egrave;s une maladie. Pour aquariums et tortues d&rsquo;eau douce.</strong></p>\r\n\r\n<p>Transforme l&rsquo;eau du robinet en eau d&rsquo;aquarium conforme au biotope des poissons. Neutralisation de substances probl&eacute;matiques telles que cuivre, zinc, plomb et chlore. Eau parfaite, poissons en bonne sant&eacute; : prot&egrave;ge muqueuses, branchies, peau et nageoires gr&acirc;ce &agrave; l&rsquo;alo&eacute; vera. Un complexe de vitamines B soutient le fonctionnement du syst&egrave;me immunitaire et agit contre le stress.</p>\', \'conditionneur-deau-biotopol-pour-aquarium-d7798b1052.jpeg\', 13, \'conditionneur-deau-biotopol-pour-aquarium\', \'JBL\', \'Bleu\', \'500 + 125 ml\', \'10x6x23 cm\'),
                            (234, 22, \'Solution Entretien Starter Box Shrimp pour Aquarium\', \'<p>La&nbsp;<strong>STARTER BOX SHRIMP</strong>&nbsp;de PRODIBIO est une solution compl&egrave;te pour d&eacute;marrer et entretenir un aquarium d&rsquo;eau douce.</p>\r\n\r\n<p>Les produits fournis sont Chloral Reset (pour &eacute;liminer le chlore et les chloramines de l&rsquo;eau), Aqua Shrimp Powder (le sol), Bacter Kit Soil (les bact&eacute;ries sp&eacute;cifiques pour coloniser votre sol), Start Up (un kit de d&eacute;marrage pour la mise en place rapide et saine de la filtration biologique) et enfin BioClean Fresh (pour l&rsquo;entretien de votre aquarium apr&egrave;s son d&eacute;marrage).</p>\r\n\r\n<p><strong>Contient :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Aqua Shrimp Powder</li>\r\n	<li>BacterKit Soil</li>\r\n	<li>Chloral Reset Nano 4</li>\r\n	<li>Start Up Nano 2</li>\r\n	<li>BioClean Fresh Nano 4</li>\r\n</ul>\', \'solution-entretien-starter-box-shrimp-pour-aquarium-85a26a8fa0.jpeg\', 37, \'solution-entretien-starter-box-shrimp-pour-aquarium\', \'Prodibio\', \'Blanc\', NULL, \'Hauteur: 20 cm\'),
                            (235, 5, \'Bactéries Épuratrices pour Poissons Rouges\', \'<p>Concentr&eacute; liquide de bact&eacute;ries (40 millions de bact&eacute;rie par ml) s&eacute;lectionn&eacute;es pour leur aptitude &agrave; dig&eacute;rer rapidement les mati&egrave;res organiques. Les bact&eacute;ries &eacute;puratrices Animalis permettent un cycle rapide et complet de l&#39;ammoniac (tr&egrave;s toxique) en nitrite puis en nitrate. Elles r&eacute;duisent l&#39;accumulation des s&eacute;diments et des boues, assainit l&#39;ensemble de l&#39;aquarium, &eacute;vite la formation d&#39;algues.</p>\r\n\r\n<p>Ce produit peut &ecirc;tre utilis&eacute; en aquarium d&#39;eau froide ou temp&eacute;r&eacute;e, d&eacute;j&agrave; en service ou en d&eacute;marrage.</p>\r\n\r\n<p><strong>Pr&eacute;caution :</strong>&nbsp;apr&egrave;s chaque utilisation, bien fermer la bouteille et conserver le produit &agrave; l&#39;abris de la chaleur et de la lumi&egrave;re. Tenir hors de port&eacute;e des enfants.</p>\', \'bacteries-epuratrices-pour-poissons-rouges-003614b393.jpeg\', 9, \'bacteries-epuratrices-pour-poissons-rouges\', \'Animalis\', NULL, \'100 ml\', NULL),
                            (236, 22, \'Test et Contrôle de la Valeur pH Test Ph\', \'<p>Pour tous les aquariums d&#39;eau douce .stabilit&eacute; &eacute;lev&eacute;e et durable .Large champ d&#39;application .R&eacute;sultat fiable et efficace</p>\', \'test-et-controle-de-la-valeur-ph-test-ph-a44667966c.jpeg\', 12, \'test-et-controle-de-la-valeur-ph-test-ph\', \'Tetra\', \'Bleu\', NULL, \'40x100x100 cm\'),
                            (237, 22, \'Bactéries Eco-Balance Probiotic\', \'<p><strong>Eco Balance Probiotic</strong>, de la gamme Reef Evolution d&#39;Aquarium Systems &agrave; pour but d&#39;am&eacute;liorer la sant&eacute; du biotope d&#39;un aquarium. Le processus chimique d&#39;un aquarium engendre un d&eacute;s&eacute;quilibre qui permet &agrave; de mauvaises bact&eacute;ries et aux algues de se d&eacute;velopper et d&#39;impacter n&eacute;gativement la qualit&eacute; de l&#39;eau. Eco Balance utilise de bonnes bact&eacute;ries, 100% naturelles et probiotiques, qui aide &agrave; r&eacute;guler le nombre de mauvaises bact&eacute;ries dans un aquarium.<br />\r\n<br />\r\n<strong>Fabriqu&eacute; en France.</strong></p>\', \'bacteries-eco-balance-probiotic-76d890bd0a.jpeg\', 13, \'bacteries-eco-balance-probiotic\', \'Aquarium Systems\', \'Violet\', NULL, \'7x15.5x3.5 cm\'),
                            (238, 22, \'Élimine les Substances Nocives Toxivec\', \'<p>&Eacute;limine les Substances Nocives Toxivec pour Aquarium.</p>\', \'elimine-les-substances-nocives-toxivec-54a06b3e3a.jpeg\', 14, \'elimine-les-substances-nocives-toxivec\', \'Sera\', NULL, \'250 ml\', \'5x5x16.5 cm\'),
                            (239, 21, \'Aquarium Vivaline LED de 240L avec Meuble\', \'<p>Le concept Vivaline LED est compos&eacute; d&#39;un aquarium et d&#39;un meuble qui consiste &agrave; offrir un &eacute;quipement personnalisable, complet et de qualit&eacute;. De plus, la s&eacute;rie Eheim Vivaline LED peut s&#39;int&eacute;grer parfaitement &agrave; votre d&eacute;cor par le biais d&#39;une planche d&eacute;corative rempla&ccedil;able. Le meuble est adapt&eacute; pour supporter en toute s&eacute;curit&eacute; l&#39;aquarium Vivaline LED 240. Il offre &eacute;galement un espace de rangement pour la filtration, le chauffage ou pour tout autre accessoire d&#39;entretien de votre aquarium. Mais le vrai + de cet ensemble est cette planche personnalisable situ&eacute;e au milieu du meuble Vivaline. Vous pouvez ainsi choisir entre 8 couleurs de personnalisation disponibles sur notre site.<br />\r\n<br />\r\nLa rampe d&#39;&eacute;clairage LED, bien lumineuse, est facilement manipulable : la technologie LED 1 x 20W permet une luminosit&eacute; bien brillante tout en &eacute;conomisant de l&#39;&eacute;nergie. La rampe d&#39;&eacute;clairage est facilement positionnable et modulable. Les panneaux coulissants sont constitu&eacute;s de panneaux composites en aluminium. Ce qui est plus pratique pour la manipulation dans votre aquarium !<br />\r\n<br />\r\n<strong>Caract&eacute;ristiques de l&#39;ensemble aquarium et meuble Vivaline LED 240 litres :</strong><br />\r\n<br />\r\n&bull; Aquarium d&#39;eau douce<br />\r\n&bull; Couleur : anthracite<br />\r\n&bull; Dimensions de l&#39;aquarium : 120x40x50cm<br />\r\n&bull; Dimensions de l&#39;aquarium + meuble : 121x41x124cm<br />\r\n&bull; &Eacute;paisseur du verre : 8/10mm<br />\r\n&bull; Contenance : 240L<br />\r\n&bull; Rampe d&#39;&eacute;clairage avec tube(s) : LED 1 x 20W<br />\r\n&bull; Filtration : Filtre Eheim EccoPro 300W<br />\r\n&bull; Chauffage : Eheim Thermocontrol 150W<br />\r\n&bull; Fabriqu&eacute; en Allemagne</p>\', \'aquarium-vivaline-led-de-240l-avec-meuble-38c24a8ad7.jpeg\', 564, \'aquarium-vivaline-led-de-240l-avec-meuble\', \'Eheim\', NULL, \'Verre\', \'122x42x125 cm\'),
                            (240, 21, \'Aquarium Iban 100\', \'<p>Votre int&eacute;rieur sera enjoliv&eacute; en compagnie de cet aquarium Aquadisio Aqua iban dot&eacute; d&#39;un design moderne et de lignes sobres. Cet aquarium avec ses dimensions agr&eacute;ables offrira un lieu de vie agr&eacute;able &agrave; vos poissons d&#39;eau douce et d&#39;eau froide. Il sera id&eacute;al pour vivre pleinement cette exp&eacute;rience magnifique qu&#39;est l&#39;aquariophilie. L&#39;aquarium iban est &eacute;quip&eacute; d&#39;une filtration et d&#39;un &eacute;clairage (ampoule LED) pour contribuer au bien-&ecirc;tre de vos poissons.&nbsp;</p>\', \'aquarium-iban-100-6036ef3cfc.jpeg\', 209, \'aquarium-iban-100\', \'Aquadisio\', \'Blanc\', \'Plastique, 156 L\', \'100x30x52 cm\'),
                            (241, 21, \'Aquarium Vivaline LED avec Meuble\', \'<p>Le concept Vivaline LED est compos&eacute; d&#39;un aquarium et d&#39;un meuble qui consiste &agrave; offrir un &eacute;quipement personnalisable, complet et de qualit&eacute;. De plus, la s&eacute;rie Eheim Vivaline LED peut s&#39;int&eacute;grer parfaitement &agrave; votre d&eacute;cor par le biais d&#39;une planche d&eacute;corative rempla&ccedil;able. Le meuble est adapt&eacute; pour supporter en toute s&eacute;curit&eacute; l&#39;aquarium Vivaline LED 180. Il offre &eacute;galement un espace de rangement pour la filtration, le chauffage ou pour tout autre accessoire d&#39;entretien de votre aquarium. Mais le vrai + de cet ensemble est cette planche personnalisable situ&eacute;e au milieu du meuble Vivaline. Vous pouvez ainsi choisir entre 8 couleurs de personnalisation disponibles sur notre site.<br />\r\n<br />\r\nLa rampe d&#39;&eacute;clairage LED, bien lumineuse, est facilement manipulable : la technologie LED 1 x 17W permet une luminosit&eacute; bien brillante tout en &eacute;conomisant de l&#39;&eacute;nergie. La rampe d&#39;&eacute;clairage est facilement positionnable et modulable. Les panneaux coulissants sont constitu&eacute;s de panneaux composites en aluminium. Ce qui est plus pratique pour la manipulation dans votre aquarium !<br />\r\n<br />\r\n<strong>Caract&eacute;ristiques de l&#39;ensemble aquarium et meuble Vivaline LED 180 litres :</strong><br />\r\n<br />\r\n&bull; Aquarium d&#39;eau douce<br />\r\n&bull; Couleur : anthracite<br />\r\n&bull; Dimensions de l&#39;aquarium : 100x40x45cm<br />\r\n&bull; Dimensions de l&#39;aquarium + meuble : 101x41x119cm<br />\r\n&bull; &Eacute;paisseur du verre : 8mm<br />\r\n&bull; Contenance : 180L<br />\r\n&bull; Rampe d&#39;&eacute;clairage avec tube(s) : LED 1 x 17W<br />\r\n&bull; Filtration : Filtre Eheim Biopower 200W<br />\r\n&bull; Chauffage : Eheim Thermocontrol 150W<br />\r\n&bull; Fabriqu&eacute; en Allemagne</p>\', \'aquarium-vivaline-led-avec-meuble-3fef201da6.jpeg\', 469, \'aquarium-vivaline-led-avec-meuble\', \'Eheim\', \'Anthracite\', \'Verre, 180 L\', \'102x42x120 cm\'),
                            (242, 21, \'Aquarium 80 LED\', \'<p>Un aquarium dot&eacute; d&rsquo;un &eacute;quipement complet pour d&eacute;couvrir l&rsquo;aquariophilie en toute confiance, &eacute;quip&eacute; d&rsquo;une pompe &agrave; eau, d&#39;un chauffage, d&#39;une pr&eacute;-installation pour une pompe &agrave; air et d&rsquo;un filtre biologique.<br />\r\nLa FOAM (mousse) de 30PPI et le Filtre CF80 Ciano&reg; assure un renouvellement optimal de l&rsquo;eau et le parfait maintien de l&rsquo;&eacute;quilibre aquatique, la dose WATER CLEAR Ciano&reg; rend l&rsquo;eau cristalline et &eacute;limine les odeurs.<br />\r\n<strong>Caract&eacute;ristiques de l&#39;aquarium Ciano 80 LED :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul><br />\r\n	<li>Cadre en plastique &quot;antichoc&quot;</li>\r\n	<br />\r\n	<li>Bords polis et biseaut&eacute;s</li>\r\n	<br />\r\n	<li>Capot avec charni&egrave;res</li>\r\n	<br />\r\n	<li>Water Clear &quot;M&quot; et mousse FOAM &quot;L&quot; pour une eau cristaline et inodore</li>\r\n	<br />\r\n	<li>&Eacute;clairage LED CLA60 Ciano&reg; (8W - 18VDC)</li>\r\n	<br />\r\n	<li>Contenance : 71L</li>\r\n	<br />\r\n	<li>Coloris : Noir</li>\r\n	<br />\r\n	<li>Dimensions : 80x30x41,5 centim&egrave;tres</li>\r\n	<br />\r\n	<br />\r\n	&nbsp;\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Contenu du paquet :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul><br />\r\n	<li>1 filtre Biologique CF80 Ciano</li>\r\n	<br />\r\n	<li>1 syst&egrave;me d&#39;&eacute;clairage LED CLA60 Ciano&reg; (8W - 18VDC)</li>\r\n	<br />\r\n	<li>1 convertisseur LED (18VDC)</li>\r\n	<br />\r\n	<li>1 pompe &agrave; eau 260 L/h</li>\r\n	<br />\r\n	<li>1 chauffage 100W</li>\r\n	<br />\r\n	<li>1 dose Water Clear &quot;M&quot; Ciano&reg;</li>\r\n	<br />\r\n	<li>1 mousse &quot;L&quot; 30PPI Ciano&reg;</li>\r\n	<br />\r\n	<li>1 notice d&#39;installation</li>\r\n</ul>\', \'aquarium-80-led-6cc717c876.jpeg\', 90, \'aquarium-80-led\', \'Ciano\', \'Noir\', \'Verre\', \'80x30x41.5 cm\'),
                            (243, 21, \'Aquarium 60 LED\', \'<p>Un aquarium dot&eacute; d&rsquo;un &eacute;quipement complet pour d&eacute;couvrir l&rsquo;aquariophilie en toute confiance, &eacute;quip&eacute; d&rsquo;une pompe &agrave; eau, d&#39;un chauffage, d&#39;une pr&eacute;-installation pour une pompe &agrave; air et d&rsquo;un filtre biologique.</p>\r\n\r\n<p>La FOAM (mousse) de 30PPI et le Filtre CF80 Ciano&reg; assure un renouvellement optimal de l&rsquo;eau et le parfait maintien de l&rsquo;&eacute;quilibre aquatique, la dose WATER CLEAR Ciano&reg; rend l&rsquo;eau cristalline et &eacute;limine les odeurs.</p>\r\n\r\n<p><strong>Caract&eacute;ristiques de l&#39;aquarium Ciano 60 LED :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Cadre en plastique &quot;antichoc&quot;</li>\r\n	<li>Bords polis et biseaut&eacute;s</li>\r\n	<li>Capot avec charni&egrave;res</li>\r\n	<li>Water Clear &quot;M&quot; et mousse FOAM &quot;L&quot; pour une eau cristaline et inodore</li>\r\n	<li>&Eacute;clairage LED CLA60 Ciano&reg; (8W - 18VDC)</li>\r\n	<li>Contenance : 58L</li>\r\n	<li>Coloris : Blanc</li>\r\n	<li>Dimensions : 60x30x33,5 centim&egrave;tres</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Contenu dans le paquet :</strong></p>\r\n\r\n<ul>\r\n	<li>1 filtre Biologique CF80 Ciano</li>\r\n	<li>1 syst&egrave;me d&#39;&eacute;clairage LED CLA60 Ciano&reg; (8W - 18VDC)</li>\r\n	<li>1 convertisseur LED (18VDC)</li>\r\n	<li>1 pompe &agrave; eau 260 L/h</li>\r\n	<li>1 chauffage 50W</li>\r\n	<li>1 dose Water Clear &quot;M&quot; Ciano&reg;</li>\r\n	<li>1 mousse &quot;L&quot; 30PPI Ciano&reg;</li>\r\n	<li>1 notice d&#39;installation</li>\r\n</ul>\', \'aquarium-60-led-b44d7e5983.jpeg\', 70, \'aquarium-60-led\', \'Ciano\', \'Blanc\', \'Verre\', \'60x30x33.5 cm\'),
                            (244, 21, \'Aquarium Emotions Nature Pro 100\', \'<p>Nouvelle gamme d&#39;aquariums qui vous aidera &agrave; d&eacute;couvrir toute la beaut&eacute; de l&#39;aquariophilie gr&acirc;ce &agrave; ses lignes s&eacute;duisantes et d&#39;excellente qualit&eacute;. Cette gamme est facile &agrave; entretenir ce qui permet un acc&egrave;s maximum &agrave; l&#39;int&eacute;rieur de l&#39;aquarium.</p>\r\n\r\n<p>La taille de cet aquarium s&#39;adapte &agrave; n&#39;importe quel espace de votre domicile.</p>\r\n\r\n<p><strong>Livr&eacute; tout &eacute;quip&eacute; avec :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>1 x filtre biologique CFBIO 250</li>\r\n	<li>1 x syst&egrave;me d&#39;&eacute;clairage LED 30W</li>\r\n	<li>1 x pompe 550 l/h</li>\r\n	<li>1 x chauffage 200W</li>\r\n	<li>2 x WaterClear</li>\r\n	<li>2 x BioBact</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Caract&eacute;ristiques :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Volume utile : 197L</li>\r\n	<li>Poids brut : 45,59Kg</li>\r\n	<li>Epaisseur du verre : 8mm</li>\r\n	<li>Couleur : Noir</li>\r\n</ul>\', \'aquarium-emotions-nature-pro-100-9a74ba6ed2.jpeg\', 349, \'aquarium-emotions-nature-pro-100\', \'Ciano\', \'Noir\', \'Verre\', \'104.5x42x63 cm\'),
                            (245, 21, \'Aquarium Nexus Design Équipé de LED + Filtre\', \'<p>Aquarium de 22L &eacute;quip&eacute; d&#39;un syst&egrave;me d&#39;&eacute;clairage LED 12v - 1,5w, d&#39;un convertisseur pour syst&egrave;me LED 12v, d&#39;un filtre int&eacute;rieur et d&#39;une dose Charbon + une mousse. Epaisseur du verre 4mm.</p>\', \'aquarium-nexus-design-equipe-de-led-filtre-443ddf0f17.jpeg\', 70, \'aquarium-nexus-design-equipe-de-led-filtre\', \'Ciano\', \'Blanc\', \'Verre\', \'29x29x29 cm\'),
                            (246, 21, \'Aquarium BiOrb Halo LED\', \'<p>Avec son style unique, alliant design et technologie, l&#39;aquarium BiOrb Halo s&#39;int&eacute;grera parfaitement &agrave; votre int&eacute;rieur ! Il est &eacute;quip&eacute; d&#39;un syst&egrave;me de filtration par exhausteur d&#39;air et d&#39;une cartouche filtrante. Sa mati&egrave;re en acrylique est plus transparente et l&eacute;g&egrave;re que le verre des aquariums classiques. Les cartes propos&eacute;es permettent de reproduire ais&eacute;ment un d&eacute;cor. L&#39;aquarium dispose &eacute;galement d&#39;un &eacute;clairage &agrave; LED.<br />\r\n<br />\r\n<strong>Un acc&egrave;s d&#39;alimentation facile :</strong><br />\r\nUn couvercle &agrave; charni&egrave;re pour une alimentation sans g&acirc;chis ainsi qu&#39;un acc&egrave;s facile pour la maintenance.<br />\r\n<br />\r\n<strong>Fermeture s&eacute;curis&eacute;e magn&eacute;tique :</strong><br />\r\nMaintient l&#39;&eacute;tanch&eacute;it&eacute; de l&#39;aquarium.<br />\r\n<br />\r\n<strong>Un acc&egrave;s d&#39;alimentation facile :</strong><br />\r\nUn couvercle &agrave; charni&egrave;re pour une alimentation sans g&acirc;chis ainsi qu&#39;un acc&egrave;s facile pour la maintenance.<br />\r\n<br />\r\n<strong>Pieds antid&eacute;rapants :</strong><br />\r\nMaintient l&#39;aquarium s&eacute;curis&eacute; sur n&#39;importe quelle surface.<br />\r\n<br />\r\n<strong>Tuyau d&#39;air subtilement cach&eacute; :</strong><br />\r\nLe tuyau d&#39;air est discr&egrave;tement int&eacute;gr&eacute; au pied, &agrave; l&#39;arri&egrave;re de l&#39;aquarium.<br />\r\n<br />\r\n<strong>Caract&eacute;ristiques de l&#39;aquarium BiOrb Halo :</strong></p>\r\n\r\n<ul>\r\n	<li>Filtre sous c&eacute;ramique et cartouche filtrante</li>\r\n	<li>Pompe &agrave; air</li>\r\n	<li>&Eacute;clairage &agrave; LED</li>\r\n	<li>Notice incluse</li>\r\n	<li>Contenance : 30L</li>\r\n	<li>Coloris : Blanc</li>\r\n	<li>Garantie 2 ans</li>\r\n	<br />\r\n	<li><strong>Conseils d&#39;entretien :</strong>&nbsp;Bien que r&eacute;sistant aux chocs, l&#39;acrlyque est sensible aux rayures. Utilisez les lingettes de nettoyage sp&eacute;cifiques pour l&#39;entretient de votre aquarium. En cas de rayure profonde, un kit de polissage est &agrave; votre disposition.</li>\r\n</ul>\', \'aquarium-biorb-halo-led-9c886f8e4c.jpeg\', 179, \'aquarium-biorb-halo-led\', \'Oase\', \'Blanc\', \'Verre\', \'40x40x46 cm\'),
                            (247, 20, \'Aliments en Pastille pour Corydoras\', \'<p>L&#39;aliment en pastilles Animalis pour Corydoras et autres poissons de fond est un aliment complet enrichi en Vitamines C, E, A et D3 et en Om&eacute;gas 3 et 6 pour donner le meilleur &agrave; vos poissons. Compl&eacute;ment&eacute; en Alo&eacute; Vera il contribue &agrave; la bonne sant&eacute; de leurs muqueuses fragiles.</p>\', \'aliments-en-pastille-pour-corydoras-8e5c82ed0e.jpeg\', 7, \'aliments-en-pastille-pour-corydoras\', \'Animalis\', \'Gris\', \'céréales, poissons et sous-produits de poissons, s\', NULL),
                            (248, 20, \'Aliment Complet ReptoMin en Sticks pour Tortues d  Eau\', \'<p>Le Tetra Reptomin granul&eacute;s pour tortue d&rsquo;eau est une alimentation compl&egrave;te sp&eacute;cialement con&ccedil;ue pour assurer la croissance et le bien-&ecirc;tre des tortues d&rsquo;eau. Riche en calcium, cette nourriture pour reptiles renforce la carapace de ces esp&egrave;ces aquatiques. Elle contient &eacute;galement des vitamines pour pr&eacute;server la sant&eacute; des reptiles.<br />\r\n<br />\r\n<strong>Caract&eacute;ristiques de l&#39;aliment Tetra ReptoMin :</strong></p>\r\n\r\n<ul>\r\n	<li>Substances nutritives essentielles, contient des prot&eacute;ines et des substances v&eacute;g&eacute;tales et min&eacute;rales</li>\r\n	<li>Enrichi en calcium</li>\r\n	<li>Assure croissance et bien-&ecirc;tre aux tortues aquatiques</li>\r\n	<li>Contribue &agrave; la formation</li>\r\n</ul>\', \'aliment-complet-reptomin-en-sticks-pour-tortues-deau-2a8ae5f724.jpeg\', 7, \'aliment-complet-reptomin-en-sticks-pour-tortues-deau\', \'Tetra\', NULL, \'Protéine brute 39,0%, Matières grasses brutes 4,5%\', NULL),
                            (249, 20, \'Aliments Granulés pour Bettas\', \'<p>L&#39;aliment en granul&eacute;s Animalis pour Bettas est un aliment complet enrichi en Vitamines C, E, A et D3 et en Om&eacute;gas 3 et 6 pour donner le meilleur &agrave; vos poissons. Compl&eacute;ment&eacute; en Axtaxanthine, il contribuesoja, poissons et sous-produits de poissons, c&eacute;r&eacute;ales, crustac&eacute;s, l&eacute;gumes, algues, algues spirulina. &agrave; renforcer leurs couleurs naturelles.</p>\', \'aliments-granules-pour-bettas-badaf423c9.jpeg\', 5, \'aliments-granules-pour-bettas\', \'Animalis\', \'Gris\', \'soja, poissons et sous-produits de poissons, céréa\', NULL),
                            (250, 5, \'Aliments granulés\', \'<p>L&#39;aliment en granul&eacute;s Animalis pour poissons &quot;Queues de voile&quot; est un aliment complet enrichi en Vitamines C, E, A et D3 et en Om&eacute;gas 3 et 6 pour donner le meilleur &agrave; vos poissons d&#39;eau froide. Compl&eacute;ment&eacute; en Axtaxanthine, il contribue &agrave; renforcer leurs couleurs naturelles.&lt;br /&gt;POISSONS ROUGES ET D&#39;EAU FROIDE</p>\', \'aliments-granules-197d4f18a9.jpeg\', 6, \'aliments-granules\', \'Animalis\', NULL, \'céréales, poissons et sous-produits de poissons, s\', NULL),
                            (251, 20, \'Aliments Granulés pour Discus\', \'<p>L&#39;aliment en granul&eacute;s Animalis pour Bettas est un aliment complet enrichi en Vitamines C, E, A et D3 et en Om&eacute;gas 3 et 6 pour donner le meilleur &agrave; vos poissons. Compl&eacute;ment&eacute; en Axtaxanthine, il contribue &agrave; renforcer leurs couleurs naturelles.</p>\', \'aliments-granules-pour-discus-3b2d4ccf09.jpeg\', 7, \'aliments-granules-pour-discus\', \'Animalis\', NULL, \'soja, poissons et sous-produits de poissons, céréa\', NULL),
                            (252, 20, \'Aliments Granulés pour Characidés et Poissons Tropicaux Mini\', \'<p>L&#39;aliment en granul&eacute;s Animalis pour Characid&eacute;s et poissons tropicaux de petite taille est un aliment complet enrichi en Vitamines C, E, A et D3 et en Om&eacute;gas 3 et 6 pour donner le meilleur &agrave; vos poissons. Tr&egrave;s riches en Prot&eacute;ines, il r&eacute;pond particuli&egrave;rement &agrave; leurs exigences nutritionnelles.</p>\', \'aliments-granules-pour-characides-et-poissons-tropicaux-mini-3145413432.jpeg\', 6, \'aliments-granules-pour-characides-et-poissons-tropicaux-mini\', \'Animalis\', NULL, \'poissons et sous-produits de poissons, céréales, s\', NULL),
                            (253, 20, \'Aliments Mini Flocons pour Alevins\', \'<p>Aliment compos&eacute; en mini flocons pour les alevins de tous les poissons omnivores et particuli&egrave;rement les ovovivipares. Enrichi en vitamines et en om&eacute;gas 3 et 6, il favorise un d&eacute;veloppement optimal.</p>\r\n\r\n<p><strong>Le saviez-vous ?</strong></p>\r\n\r\n<p>Les poissons ovovivipares tels que les Guppys, entre-autres, sont des poissons dont la femelle expulse directement les alevins tout juste &eacute;clos. Ainsi, les alevins sont autonomes d&egrave;s la naissance !</p>\r\n\r\n<p><strong>Utilisation :</strong>&nbsp;donnez deux ou trois fois par jour une quantit&eacute; suffisante que les poissons puissent manger rapidement.</p>\', \'aliments-mini-flocons-pour-alevins-cc2ca12c63.jpeg\', 4, \'aliments-mini-flocons-pour-alevins\', \'Animalis\', NULL, \'Céréales, poissons et sous-produits de poissons, s\', NULL),
                            (254, 20, \'Granulés Goldy Gran pour Poissons Rouges\', \'<p>Aliment en granul&eacute;s pour poissons rouge.</p>\', \'granules-goldy-gran-pour-poissons-rouges-eea30277a8.jpeg\', 7, \'granules-goldy-gran-pour-poissons-rouges\', \'Sera\', NULL, \'Farine de poisson, amidon de maïs, farine de blé, \', NULL)');
        $this->addSql('INSERT INTO `product` (`id`, `sub_category_id`, `title`, `description`, `photo`, `price`, `slug`, `marque`, `color`, `composition`, `dimension`) VALUES
                            (295, 14, \'Arbre à Chat Cube - Marron\', \'<p>Arbre &agrave; chat avec deux plateaux et cube t&ecirc;te de chat avec poteaux en sisal et pompon de jeu.</p>\', \'arbre-a-chat-cube-marron-c9455fb47a.jpeg\', 49.95, \'arbre-a-chat-cube-marron\', \'Animalis\', \'Marron\', \'Polyester\', \'49x33x39 cm\'),
