                            (300, 14, \'Arbre à Chat Divan\', \'<p>D&eacute;couvrez la nouvelle gamme d&#39;arbre &agrave; chat&nbsp;<strong>Animalis</strong>&nbsp;qui vous simplifie la vie gr&acirc;ce son nouveau syst&egrave;me de fixation rapide et r&eacute;sistant par clips, sans aucun outil n&eacute;cessaire ! Le montage de cet arbre &agrave; chat est donc d&#39;une simplicit&eacute; unique. L&#39;arbre &agrave; chat Animalis est ainsi tr&egrave;s solide et stimule l&#39;activit&eacute; de votre chat et est &eacute;galement id&eacute;al pour sa croissance.</p>\r\n\r\n<p><strong>Caract&eacute;ristiques de l&#39;arbre &agrave; chat Animalis :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n <li>Fixation rapide et r&eacute;sistante</li>\r\n <li>Montage rapide et sans outils</li>\r\n  <li>Griffoirs en corde</li>\r\n <li>Jouets suspendus inclus</li>\r\n  <li>Polyester et sisal pour chat</li>\r\n</ul>\', \'arbre-a-chat-divan-f0d06fcdad.jpeg\', 89, \'arbre-a-chat-divan\', \'Anka\', \'beige\', \'bois\', \'41x51x86\'),
                            (301, 14, \'Arbre à Chat Nougat\', \'<p>D&eacute;couvrez la nouvelle gamme d&#39;arbre &agrave; chat&nbsp;<strong>Animalis</strong>&nbsp;qui vous simplifie la vie gr&acirc;ce son nouveau syst&egrave;me de fixation rapide et r&eacute;sistant par clips, sans aucun outil n&eacute;cessaire ! Le montage de cet arbre &agrave; chat est donc d&#39;une simplicit&eacute; unique. L&#39;arbre &agrave; chat Animalis est ainsi tr&egrave;s solide et stimule l&#39;activit&eacute; de votre chat et est &eacute;galement id&eacute;al pour sa croissance.</p>\r\n\r\n<p><strong>Caract&eacute;ristiques de l&#39;arbre &agrave; chat Animalis :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n  <li>Fixation rapide et r&eacute;sistante</li>\r\n <li>Montage rapide et sans outils</li>\r\n  <li>Griffoirs en corde</li>\r\n <li>Jouet suspendu inclus</li>\r\n  <li>Polyester et sisal pour chat</li>\r\n</ul>\', \'arbre-a-chat-nougat-4c5353ead9.jpeg\', 169, \'arbre-a-chat-nougat\', \'Acana\', \'beige-blanc\', \'bois\', \'140x140x165 cm\'),
                            (302, 15, \'Chatière Swing T11\', \'<p>Cette chati&egrave;re swing vous permettra de donner plus de libert&eacute; &agrave; votre chat mais aussi aux petits chiens, et de vous soulager de la corv&eacute;e d&#39;ouverture de la porte. Cette porte battante pourra &ecirc;tre programm&eacute;e sur 4 positions : entr&eacute;e seule, sortie seule, entr&eacute;e et sortie, et position ferm&eacute;e. Vous pourrez ainsi contr&ocirc;ler les allers et venues de votre petit chien sans contrainte, en toute simplicit&eacute; et sans subir aucun courant d&#39;air. D&#39;une installation universelle, cette chati&egrave;re en plastique marron offrira une libert&eacute; de mouvement sans limite &agrave; votre f&eacute;lin.</p>\', \'chatiere-swing-t11-ae51498311.jpeg\', 52.95, \'chatiere-swing-t11\', \'Ferplast\', \'Bleu-gris\', \'Plastique\', \'49x33 cm\'),
                            (303, 15, \'Chatière Swing B3\', \'<p>Cette chati&egrave;re swing vous permettra de donner plus de libert&eacute; &agrave; votre chat et de vous soulager de la corv&eacute;e d&#39;ouverture de la porte. D&#39;une installation universelle, cette chati&egrave;re en plastique marron offrira une libert&eacute; de mouvement sans limite &agrave; votre f&eacute;lin. Cette porte battante pourra &ecirc;tre programm&eacute;e sur une des 4 positions : entr&eacute;e seule, sortie seule, entr&eacute;e et sortie, et position ferm&eacute;e.</p>\', \'chatiere-swing-b3-9dd99dae4f.jpeg\', 20.95, \'chatiere-swing-b3\', \'Acana\', \'noir\', \'Plastique\', \'54x80 cm\'),
                            (304, 5, \'Porte StayWell Luxe 300SGIFD\', \'<p>Gr&acirc;ce &agrave; cette chati&egrave;re StayWell vous pouvez r&eacute;gler cette chati&egrave;re selon 4 modes diff&eacute;rents : position ouverte, position ferm&eacute;e, entr&eacute;e uniquement ou sortie uniquement.</p>\r\n\r\n<p><strong>Caract&eacute;ristiques :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n <li>Pour les chats de 7 kilos maximum</li>\r\n  <li>Cl&eacute; permettant le verrouilage &agrave; 4 positions</li>\r\n  <li>Dimensions de d&eacute;coupe : 17,5x16,8 centim&egrave;tres</li>\r\n  <li>Dimensions totale : 25,2x24,1 centim&egrave;tres</li>\r\n <li>Vis de montage</li>\r\n <li>Instructions de d&eacute;coupe et guide d&#39;installation</li>\r\n <li>Coloris : Blanc</li>\r\n</ul>\', \'porte-staywell-luxe-300sgifd-da72d034eb.jpeg\', 37.1, \'porte-staywell-luxe-300sgifd\', \'PetSafe\', \'blanc\', \'Plastique\', \'25,2x24,1 cm\'),
                            (305, 15, \'Collier Supplémentaire Infrarouge pour StayWell 500SGIFD\', \'<p>Gr&acirc;ce &agrave; cette chati&egrave;re StayWell vous pouvez r&eacute;gler cette chati&egrave;re selon 4 modes diff&eacute;rents : position ouverte, position ferm&eacute;e, entr&eacute;e uniquement ou sortie uniquement.</p>\r\n\r\n<p><strong>Caract&eacute;ristiques :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n  <li>Pour les chats de 7 kilos maximum</li>\r\n  <li>Cl&eacute; permettant le verrouilage &agrave; 4 positions</li>\r\n  <li>Dimensions de d&eacute;coupe : 17,5x16,8 centim&egrave;tres</li>\r\n  <li>Dimensions totale : 25,2x24,1 centim&egrave;tres</li>\r\n <li>Vis de montage</li>\r\n <li>Instructions de d&eacute;coupe et guide d&#39;installation</li>\r\n</ul>\', \'collier-supplementaire-infrarouge-pour-staywell-500sgifd-b500d073e6.jpeg\', 26.9, \'collier-supplementaire-infrarouge-pour-staywell-500sgifd\', \'PetSafe\', \'Rose\', \'Plastique\', \'49x33 cm\'),
                            (306, 15, \'Collier Supplémentaire Infrarouge pour StayWell 500SGIFD\', \'<p>Gr&acirc;ce &agrave; cette chati&egrave;re StayWell vous pouvez r&eacute;gler cette chati&egrave;re selon 4 modes diff&eacute;rents : position ouverte, position ferm&eacute;e, entr&eacute;e uniquement ou sortie uniquement.</p>\r\n\r\n<p><strong>Caract&eacute;ristiques :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n  <li>Pour les chats de 7 kilos maximum</li>\r\n  <li>Cl&eacute; permettant le verrouilage &agrave; 4 positions</li>\r\n  <li>Dimensions de d&eacute;coupe : 17,5x16,8 centim&egrave;tres</li>\r\n  <li>Dimensions totale : 25,2x24,1 centim&egrave;tres</li>\r\n <li>Vis de montage</li>\r\n <li>Instructions de d&eacute;coupe et guide d&#39;installation</li>\r\n</ul>\', \'collier-supplementaire-infrarouge-pour-staywell-500sgifd-560e34b737.jpeg\', 26.9, \'collier-supplementaire-infrarouge-pour-staywell-500sgifd\', \'PetSafe\', \'Vert\', \'Plastique\', \'54x89x128 cm\'),
                            (307, 15, \'Chatière Swing 7 Set Magnétique\', \'<p>&nbsp;La gamme Swing de Ferplast, vous pourrez installer une porte pour animaux, consacr&eacute;e exclusivement &agrave;&nbsp; votre ami &agrave;&nbsp; quatre pattes, dans n&#39;importe quelle porte en bois, en m&eacute;tal ou en verre et murs en briques.<br />\r\nPour les chats et chiots, nous vous recommandons la Swing 1, 3 ou 5. Pour chiens moyens et grands, ainsi que grands f&eacute;lins, les Swing 11 ou 15 particuli&egrave;rement adapt&eacute;s. Le mod&egrave;le Swing 7, &eacute;quip&eacute; d&#39;un syst&egrave;me magn&eacute;tique, est parfait pour les chats.<br />\r\nCes chati&egrave;res sont &eacute;quip&eacute;es de syst&egrave;me innovant &quot;wind stopper&quot;, syst&egrave;me de protection contre les courants d&#39;air (&agrave;&nbsp; l&#39;exception de la Swing 1 et 3 mod&egrave;les qui ne l&#39;ont pas). Une autre caract&eacute;ristique importante est le syst&egrave;me de fermeture &agrave;&nbsp; 4 positionse (non pr&eacute;sent dans le mod&egrave;le de Swing 1) qui vous permet re r&eacute;gler le type d&#39;ouverture selon vos besoins : entr&eacute;e uniquement, sortie uniquement, entr&eacute;e et sortie, ou ferm&eacute;. Enfin, un indicateur de passage (fourni avec Swing 5 et 7) vous aidera &agrave;&nbsp; savoir si votre animal est &agrave;&nbsp; l&#39;int&eacute;rieur ou &agrave;&nbsp; l&#39;ext&eacute;rieur, il repr&eacute;sente une petite languette, plac&eacute;e au bas de la porte qui se placera dans la direction prise par votre petit animal. Les grands mod&egrave;les disposent d&#39;un tunnel permettant ainsi de s&#39;adapter &agrave;&nbsp; toute structure et pouvant &ecirc;tre coup&eacute;. Pour les mod&egrave;les 1, 3 et 5, livr&eacute;s tunnels partiels, une extension modulable est disponible en option, elle mesure 5 cm de profondeur (les vis ne sont pas inclues). Important : avant d&#39;installer la chati&egrave;re sur une structure en verre, nous vous conseillons de consulter un vitrier, car il n&#39;est pas possible de percer des trous dans le verre de s&eacute;curit&eacute; tremp&eacute; ou double vitrage sauf si ils ont &eacute;t&eacute; cr&eacute;&eacute;es pr&eacute;c&eacute;demment lors de la fabrication. &Acirc;&raquo;</p>\', \'chatiere-swing-7-set-magnetique-91c2e3c2ac.jpeg\', 49.95, \'chatiere-swing-7-set-magnetique\', \'Ferplast\', \'beige\', \'Plastique\', \'49x33x39 cm\'),
                            (308, 15, \'Chatière Swing Microchip\', \'<p>La chati&egrave;re Swing Microchip est une chati&egrave;re &eacute;lectronique en plastique blanc qui reconnait la puce sous-cutan&eacute;e de votre chat pour lui permettre d&#39;&eacute;voluer librement entre la maison et le jardin ! Pas de puce, pas d&#39;acc&egrave;s : la porte demeure bloqu&eacute;e aux visiteurs ind&eacute;sirables !</p>\r\n\r\n<p>La chati&egrave;re Swing fonctionn peut m&eacute;moriser jusqu&#39;&agrave; 32 puces standard ISO d&#39;un simple geste : il suffit d&#39;appuyer sur le bouton m&eacute;moire pour enregistrer le code. La chati&egrave;re peut &ecirc;tre r&eacute;gler sur 4 positions diff&eacute;rentes : entr&eacute;e autoris&eacute;e uniquement, sortie autoris&eacute;e uniquement, entr&eacute;e et sortie autoris&eacute;es ou porte ferm&eacute;e. Cette chati&egrave;re fonctionne avec 6 piles AA (non fournies) et permet de vous indiquer le dernier passage de votre animal (entrant ou sortant) et lorsque les piles sont d&eacute;charg&eacute;es. Elle convient aux portes pleines (en bois ou en m&eacute;tal), aux portes vitr&eacute;es et aux parois mur&eacute;es.</p>\r\n\r\n<p><strong>Caract&eacute;ristiques :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n <li>Pour les chats de moins de 7 kilos</li>\r\n <li>R&eacute;glable sur 4 positions diff&eacute;rentes</li>\r\n <li>Peut m&eacute;moriser jusqu&#39;&agrave; 32 puces</li>\r\n  <li>Indicateur de dernier passage</li>\r\n  <li>&Eacute;paisseur : 16,2cm</li>\r\n</ul>\', \'chatiere-swing-microchip-afde851343.jpeg\', 139, \'chatiere-swing-microchip\', \'PetSafe\', \'blanc\', \'Plastique\', \'13,5x13,7cm\'),
                            (309, 15, \'Chatière Swing T5\', \'<p>Cette chati&egrave;re swing vous permettra de donner plus de libert&eacute; &agrave; votre chat et de vous soulager de la corv&eacute;e d&#39;ouverture de la porte. Cette porte battante pourra &ecirc;tre programm&eacute;e sur une des 4 positions : entr&eacute;e seule, sortie seule, entr&eacute;e et sortie, et position ferm&eacute;e. Cette chati&egrave;re poss&egrave;de un indicateur de passage, vous saurez ainsi si F&eacute;lix est rentr&eacute; ou non. Vous pourrez &eacute;galement contr&ocirc;ler les allers et venues de votre chat sans contrainte, en toute simplicit&eacute; et sans subir aucun courant d&#39;air. D&#39;une installation universelle, cette chati&egrave;re en plastique marron offrira une libert&eacute; de mouvement sans limite &agrave; votre f&eacute;lin.</p>\', \'chatiere-swing-t5-d80bc2572d.jpeg\', 34.95, \'chatiere-swing-t5\', \'Ferplast\', \'blanc\', \'Plastique\', \'19x20x39 cm\'),
                            (310, 15, \'Chatière Swing T15\', \'<p>Cette chati&egrave;re swing vous permettra de donner plus de libert&eacute; &agrave; votre chat mais aussi &agrave; votre petit chien, et de vous soulager de la corv&eacute;e d&#39;ouverture de la porte. Cette porte battante pourra &ecirc;tre programm&eacute;e sur 4 positions : entr&eacute;e seule, sortie seule, entr&eacute;e et sortie, et position ferm&eacute;e. Vous pourrez ainsi contr&ocirc;ler les allers et venues de votre chat sans contrainte, en toute simplicit&eacute; et sans subir aucun courant d&#39;air. D&#39;une installation universelle, cette chati&egrave;re en plastique marron offrira une libert&eacute; de mouvement sans limite &agrave; votre f&eacute;lin.</p>\', \'chatiere-swing-t15-218e8e619f.jpeg\', 69.95, \'chatiere-swing-t15\', \'Ferplast\', \'blanc\', \'Plastique\', \'15x13 x51 cm\'),
                            (311, 15, \'Aimant pour Chatière Swing\', \'<p>Optez pour la praticit&eacute; de cet aimant pour chati&egrave;re Swing. Il se fixe sur un collier Lin&eacute;ar et permet d&#39;activer l&#39;ouverture de la chati&egrave;re. Produit de qualit&eacute;, cet aimant pour chati&egrave;re Swing vous apportera des r&eacute;sultats &agrave; la hauteur de vos attentes.</p>\r\n\r\n<p>&nbsp;</p>\', \'aimant-pour-chatiere-swing-faba150f2c.jpeg\', 3.95, \'aimant-pour-chatiere-swing\', \'PetSafe\', \'Noir\', \'Plastique\', \'3,5 x 2,7 x 1,5 cm\'),
                            (312, 16, \'Litière Agglomérante\', \'<p>La liti&egrave;re Canada Litter est faite &agrave; base de bentonite sodique et est produite au Canada.<br />\r\n<br />\r\nLa bentonite sodique est une argile min&eacute;rale caract&eacute;ris&eacute;e par ses capacit&eacute;s d&#39;expansion, d&#39;absorption et de faible perm&eacute;abilit&eacute;. Son principal composant min&eacute;ral est la montmorillonite et, m&ecirc;me si l&#39;on retrouve la bentonite partout dans le monde, les couches de bentonite de grande qualit&eacute; sont extr&ecirc;mement rares. Nos fines granules de bentonite rappellent aux chats leur environnement naturel.<br />\r\n<br />\r\nComme sa capacit&eacute; d&#39;absorption est de 350 % (soit de 3,5 fois son poids), la liti&egrave;re Canada Litter poss&egrave;de une grande capacit&eacute; agglom&eacute;rante et d&#39;importantes propri&eacute;t&eacute;s d&#39;absorption. Tout liquide est instantan&eacute;ment transform&eacute; en galette qu&#39;il s&#39;agit de ramasser quotidiennement pour &eacute;viter la formation de bact&eacute;ries dans le bac. Nos parfums &agrave; base d&#39;huiles essentielles sont sans danger pour les chats et ont &eacute;t&eacute; con&ccedil;us en guise de pr&eacute;caution pour contr&ocirc;ler toute odeur ind&eacute;sirable qui pourrait persister dans le bac &agrave; liti&egrave;re.<br />\r\n&nbsp;</p>\', \'litiere-agglomerante-a74ebcfdc5.jpeg\', 13.3, \'litiere-agglomerante\', \'Canada Litter\', \'Marron\', \'Bentonite de sodium pure.\', NULL),
                            (313, 16, \'Litière Minérale Hygiene\', \'<p>La liti&egrave;re Catsan&trade; Hygiene plus est compos&eacute;e de grains min&eacute;raux, constitu&eacute;s de craie fine et de sable de quartz, qui absorbent instantan&eacute;ment les liquides comme une &eacute;ponge. Leur composition min&eacute;rale unique emp&ecirc;che le d&eacute;veloppement des odeurs plus efficacement que les liti&egrave;res pour chats classiques min&eacute;rales non agglom&eacute;rantes.</p>\r\n\r\n<p>La liti&egrave;re pour chat Catsan&trade; Hygiene Plus est disponible en format sac de 10L.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n <li>Haute absorption des liquides et des odeurs</li>\r\n  <li>3x plus absorbante qu&#39;une liti&egrave;re classique</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>MODE D&#39;EMPLOI :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n <li>Remplissez le bac d&rsquo;une couche de liti&egrave;re CATSAN&trade; d&rsquo;environ 5 cm</li>\r\n  <li>Retirez tous les jours du bac les excr&eacute;ments solides du chat</li>\r\n  <li>Renouvelez la totalit&eacute; de la liti&egrave;re CATSAN&trade; r&eacute;guli&egrave;rement</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ne pas jeter dans les toilettes.</p>\', \'litiere-minerale-hygiene-7bbbd0c998.jpeg\', 14.5, \'litiere-minerale-hygiene\', \'Catsan\', \'Bleu\', \'grains minéraux,  craie fine et de sable de quartz\', \'20L\'),
                            (314, 16, \'Litière Végétale Original\', \'<p>La liti&egrave;re&nbsp;<strong>Cat&#39;s Best Original</strong>, nouvelle version de la liti&egrave;re Cat&#39;s Best &Ouml;ko Plus, est jusqu&#39;&agrave; 3 fois plus &eacute;conomique qu&#39;une liti&egrave;re agglom&eacute;rante classique ! Con&ccedil;ue &agrave; partir de fibres v&eacute;g&eacute;tales naturelles, cette liti&egrave;re b&eacute;n&eacute;ficie de microfibres qui sont 100% naturelles et sans additifs lui permettant d&#39;absorber et d&#39;enfermer &agrave; l&#39;int&eacute;rieur de la fibre tout liquide, odeurs et germes. Ainsi, cette liti&egrave;re prot&egrave;ge votre foyer des mauvaises odeurs et des germes. En retennant plus efficacement les liquides, la liti&egrave;re Cat&#39;s Best Original est plus &eacute;conomique et donc plus rentable que de nombreuses autres liti&egrave;res pour chat.<br />\r\n<br />\r\nGr&acirc;ce &agrave; son fort pouvoir d&#39;absorption et d&eacute;sodorisant, vous pouvez laisser la liti&egrave;re beaucoup plus longtemps dans le bac &agrave; liti&egrave;re sans avoir l&#39;apparition d&#39;odeurs d&eacute;sagr&eacute;ables.<br />\r\n<br />\r\n<strong>Caract&eacute;ristiques de la liti&egrave;re Cat&#39;s Best Original :</strong></p>\r\n\r\n<ul>\r\n <li>Avec pi&egrave;ges &agrave; odeurs et &agrave; germes : pas d&#39;additifs artificiels et chimiques</li>\r\n  <li>&Eacute;conomique : la liti&egrave;re de base dure pour 4 &agrave; 6 semaines</li>\r\n  <li>Absorbe les liquides et les odeurs : jusqu&#39;&agrave; 700% d&#39;absorption (sachant que les liti&egrave;res traditionnelles absorbent jusqu&#39;&agrave; 200%)</li>\r\n  <li>&Eacute;cologique : 100% fibres v&eacute;g&eacute;tales</li>\r\n  <li>Compostable et 100% bio-d&eacute;gradables</li>\r\n <li>Beaucoup moins de d&eacute;chets</li>\r\n <li>L&eacute;g&egrave;re et facile &agrave; transporter</li>\r\n  <li>Liti&egrave;re agglom&eacute;r&eacute;e et les excr&eacute;ments peuvent &ecirc;tre jet&eacute;es dans les toilettes (respecter les r&eacute;glementations locales)</li>\r\n  <li>Particuli&egrave;rement adapt&eacute;e aux chats &agrave; poils longs</li>\r\n  <li>douce pour les pattes</li>\r\n  <br />\r\n  <li><strong>Conseil d&#39;utilisation :</strong>&nbsp;ne mettre seulement que les boules agglom&eacute;r&eacute;es dans les toilettes, attendre qu&#39;elles se dissolvent puis tirer la chasse d&#39;eau. Mettre le reste de liti&egrave;re (hors souillures) dans le bac &agrave; compost ou dans la poubelle. &Agrave; noter : cette liti&egrave;re n&#39;est pas comestible.</li>\r\n</ul>\', \'litiere-vegetale-original-6404a2b372.jpeg\', 31.95, \'litiere-vegetale-original\', \'Cat  s Best\', \'Vert\', \'Écologique : 100% fibres végétales Compostable et \', \'40L\'),
                            (315, 16, \'Litière Silice Agglomérante\', \'<p>La liti&egrave;re de silice est un produit&nbsp;.<br />\r\n<br />\r\nUn produit min&eacute;rale caract&eacute;ris&eacute;e par ses capacit&eacute;s d&#39;expansion, d&#39;absorption et de faible perm&eacute;abilit&eacute;. Son principal composant min&eacute;ral est la montmorillonite et, m&ecirc;me si l&#39;on retrouve la bentonite partout dans le monde, les couches de bentonite de grande qualit&eacute; sont extr&ecirc;mement rares. Nos fines granules de bentonite rappellent aux chats leur environnement naturel.<br />\r\n<br />\r\nComme sa capacit&eacute; d&#39;absorption est de 350 % (soit de 3,5 fois son poids), la liti&egrave;re Canada Litter poss&egrave;de une grande capacit&eacute; agglom&eacute;rante et d&#39;importantes propri&eacute;t&eacute;s d&#39;absorption. Tout liquide est instantan&eacute;ment transform&eacute; en galette qu&#39;il s&#39;agit de ramasser quotidiennement pour &eacute;viter la formation de bact&eacute;ries dans le bac. Nos parfums &agrave; base d&#39;huiles essentielles sont sans danger pour les chats et ont &eacute;t&eacute; con&ccedil;us en guise de pr&eacute;caution pour contr&ocirc;ler toute odeur ind&eacute;sirable qui pourrait persister dans le bac &agrave; liti&egrave;re.</p>\', \'litiere-silice-agglomerante-b2b893d8f3.jpeg\', 27.95, \'litiere-silice-agglomerante\', \'Animalis\', \'blanc\', \'Litière de silice\', \'16L\')');
